import React from 'react'

const Navbar = () => {


    return (
        <div className='navbar'>
            <span>My Notes</span>
            <div className='darkMode-switch'>
                <input type="checkbox" defaultChecked="False" />
            </div>
        </div>
    )
}

export default Navbar
